import React from "react"
import { Route } from "react-router-dom"

function userIsLoggedIn(){
    return false
}

export default function AppRouter({path, component, isPrivate}){
    isPrivate && !userIsLoggedIn() ? component = {component} : component = {component}
    return(
        <Route
           path={path}
           component={comp}
        />
    )
}
